  <script>
    const mainVideo = document.getElementById('mainVideo');
    const bgVideo = document.getElementById('bgVideo');
    const container = document.getElementById('container');

    // 自动播放两个视频（兼容部分浏览器）
    Promise.all([mainVideo.play(), bgVideo.play()]).catch(() => {
      // 如果自动播放失败（浏览器限制），可以在点击后触发
      console.log('Autoplay was prevented. Click to start playback.');
    });

    // 前景视频播放完后，两个视频都暂停
    mainVideo.addEventListener('ended', () => {
      mainVideo.pause();
      bgVideo.pause();
    });

    // 点击屏幕重新播放两个视频
    container.addEventListener('click', () => {
      if (mainVideo.paused) {
        mainVideo.currentTime = 0;
        bgVideo.currentTime = 0;
        mainVideo.play();
        bgVideo.play();
      }
    });
  </script>
